"use strict";(self.webpackChunksiemienik_com=self.webpackChunksiemienik_com||[]).push([[1477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2023/10/20/exceljs-v4-4-0","metadata":{"permalink":"/blog/2023/10/20/exceljs-v4-4-0","editUrl":"https://github.com/siemienik/siemienik.github.io/edit/master/blog/2023-10-20-exceljs-v4-4-0.md","source":"@site/blog/2023-10-20-exceljs-v4-4-0.md","title":"\ud83d\ude80 ExcelJS v4.4.0","description":"Exciting News from ExcelJS!","date":"2023-10-20T00:00:00.000Z","formattedDate":"October 20, 2023","tags":[{"label":"Release","permalink":"/blog/tags/release"},{"label":"Spreadsheets","permalink":"/blog/tags/spreadsheets"},{"label":"Collaboration","permalink":"/blog/tags/collaboration"},{"label":"SoftwareDevelopment","permalink":"/blog/tags/software-development"},{"label":"OpenSource","permalink":"/blog/tags/open-source"},{"label":"ExcelJS","permalink":"/blog/tags/excel-js"},{"label":"MergeFest","permalink":"/blog/tags/merge-fest"}],"readingTime":0.765,"hasTruncateMarker":false,"authors":[{"name":"Pawel Siemienik","title":"Founder","url":"/pawel","imageURL":"https://avatars.githubusercontent.com/u/2893099?v=4"}],"frontMatter":{"title":"\ud83d\ude80 ExcelJS v4.4.0","author":"Pawel Siemienik","author_title":"Founder","author_url":"/pawel","author_image_url":"https://avatars.githubusercontent.com/u/2893099?v=4","tags":["Release","Spreadsheets","Collaboration","SoftwareDevelopment","OpenSource","ExcelJS","MergeFest"]},"unlisted":false,"nextItem":{"title":"Empowering Open Source: SiemaTeam\'s Journey","permalink":"/blog/2023/04/28/siema-team-and-merge-fests"}},"content":"## Exciting News from ExcelJS!\\n\\nThe long-awaited Version 4.4.0 of ExcelJS has been launched, and it\'s brimming with new features and improvements. That is significant milestone, thank you to every contributor and user! \\n\\n## What\'s New?\\n\\n36 PRs merged, with bug fixes, new features, and TypeScript improvements. \\n\\nRead more details on GH: https://github.com/exceljs/exceljs/releases/tag/v4.4.0\\n\\n## What\'s Next?\\n\\nPlease follow pinned discussions on GH project page. There is currently three topics.  \\n\\n* [Next Patch (v4.4.1) #2573](https://github.com/exceljs/exceljs/discussions/2573) - about what will be included in the sooner release.\\n* [Next Minor (v4.5.0) #2574](https://github.com/exceljs/exceljs/discussions/2574) - about new features planned.\\n* [(New in v4.5.0) Pivot Table #2575](https://github.com/exceljs/exceljs/discussions/2575) - about PivotTable feature and current limitations. \\n\\nYour suggestion are welcomed, feel free to join our Discord: https://discord.gg/siema .\\n\\n## Feedback & Collaboration:\\n\\nYour feedback is invaluable. Explore the latest version, and let us know your thoughts.\\nFor those seeking expert advice or collaboration opportunities, feel free to reach out at consulting@siemienik.com."},{"id":"/2023/04/28/siema-team-and-merge-fests","metadata":{"permalink":"/blog/2023/04/28/siema-team-and-merge-fests","editUrl":"https://github.com/siemienik/siemienik.github.io/edit/master/blog/2023-04-28-siema-team-and-merge-fests.md","source":"@site/blog/2023-04-28-siema-team-and-merge-fests.md","title":"Empowering Open Source: SiemaTeam\'s Journey","description":"Hello hello, I\'m delighted to share some updates with you regarding the current situation. First off, I\'ve launched @SiemaTeam, where together we organize MergeFests. These are online meetings where we collaboratively conduct code reviews and merge PRs from ExcelJS and XToolset. So far, we\'ve already had four such events, and the next one - the fifth - starts soon! There\'s another surprise, for those who missed ExcelJS releases - ~I published a fork @siema-team/spreadsheets, which contains the latest and always up-to-date version of the main library.~","date":"2023-04-28T00:00:00.000Z","formattedDate":"April 28, 2023","tags":[{"label":"OpenSource","permalink":"/blog/tags/open-source"},{"label":"ExcelJS","permalink":"/blog/tags/excel-js"},{"label":"XToolset","permalink":"/blog/tags/x-toolset"},{"label":"MergeFest","permalink":"/blog/tags/merge-fest"},{"label":"SiemaTeam","permalink":"/blog/tags/siema-team"},{"label":"Spreadsheets","permalink":"/blog/tags/spreadsheets"},{"label":"Collaboration","permalink":"/blog/tags/collaboration"},{"label":"TypeScript","permalink":"/blog/tags/type-script"},{"label":"SoftwareDevelopment","permalink":"/blog/tags/software-development"}],"readingTime":6.01,"hasTruncateMarker":true,"authors":[{"name":"Pawel Siemienik","title":"Founder","url":"/pawel","imageURL":"https://avatars.githubusercontent.com/u/2893099?v=4"}],"frontMatter":{"title":"Empowering Open Source: SiemaTeam\'s Journey","author":"Pawel Siemienik","author_title":"Founder","author_url":"/pawel","author_image_url":"https://avatars.githubusercontent.com/u/2893099?v=4","tags":["OpenSource","ExcelJS","XToolset","MergeFest","SiemaTeam","Spreadsheets","Collaboration","TypeScript","SoftwareDevelopment"]},"unlisted":false,"prevItem":{"title":"\ud83d\ude80 ExcelJS v4.4.0","permalink":"/blog/2023/10/20/exceljs-v4-4-0"},"nextItem":{"title":"XToolset v2.4.4","permalink":"/blog/2021/11/11/release-version-2.4.4"}},"content":"Hello hello, I\'m delighted to share some updates with you regarding the current situation. First off, I\'ve launched [@SiemaTeam](https://discord.gg/siema), where together we organize MergeFests. These are online meetings where we collaboratively conduct code reviews and merge PRs from **ExcelJS** and **XToolset**. So far, we\'ve already had four such events, and the next one - the fifth - starts soon! There\'s another surprise, for those who missed ExcelJS releases - ~I published a fork `@siema-team/spreadsheets`, which contains the latest and always up-to-date version of the main library.~\\n\\n***EDIT 20-11-2023:** I received permissions to publish `exceljs` npm package, and restored releasing cycle.*\\n\\n\x3c!-- truncate --\x3e\\n\\n## SiemaTeam - Open Source maintainers\\n\\n[@SiemaTeam](https://discord.gg/siema) is enthusiastic team of volunteers who are passionate about supporting open-source initiatives. If you\'re in need of assistance, consultancy, or if you\'d like to join us in contributing to the growth and development of these projects, please don\'t hesitate to reach out to us at:\\n\\n<center>\\n\\n[![SiemaTeam](https://discordapp.com/api/guilds/976854442009825321/widget.png?style=banner2)](https://discord.gg/siema)\\n\\n**or siema@siemienik.com**\\n\\n</center>\\n\\n\\n\x3c!-- AutoLangGPT: from=\\"PL\\" to=\\"ENG\\" input=\\nNaszym celem jest wspolnie rozwijac projekty opensource i upowszechniac ich zastosowanie. Wierzymy, ze w ten sposob mozemy miec swoj wlasny wklad rozwoj cywilizacji. Jesli wydaje ci sie to ciekawe, mozesz do nas dolaczyc. Jestesmy bardzo otwarci na wszelkie contrybucje, w tym dyskusje i wspolne projekty. \\n\\nA co my z tego mamy? Na pierwszy rzut oka, wydaje sie ze nic. Robimy to w ramach wolontariatu. Ale musisz wiedziec ze przynosi to mas\u0119 satysfakcji i pozwala poznawac ciekawych ludzi z calego swiata o podobnym (lub nie) podejsciu do Open Source-a. Dla mnie osobiscie, chwile spedzone w tej spolecznosci sa niezastapione. zapraszam rowniez i ciebie.\\n--\x3e\\n\\nOur goal is to collaboratively develop open-source projects and promote their use. We believe that by doing so, we can contribute to the advancement of civilization. If this sounds interesting to you, feel free to join us. We are very open to all kinds of contributions, including discussions and collaborative projects.\\n\\nWhat\'s in it for us? At first glance, it seems like nothing. We do this as volunteers. However, you should know that it brings immense satisfaction and allows us to meet interesting people from around the world with similar (or different) approaches to Open Source. Personally, the moments spent in this community are irreplaceable. I warmly invite you to join us as well.\\n\\n## MergeFests\\n\\nWhat is a MergeFest? I explained it once on [LinkedIn post](https://www.linkedin.com/posts/siemienik_join-the-siema-discord-server-activity-7053853033994039296-twYT):\\n\\n> \ud83d\udc4b #MergeFest is an opportunity to #review PRs and Issues, do reviews, and merge. The whole event is, of course, accompanied by a great discussion among #ExcelJS #contributors.\\n>\\n> Agenda:\\n> \\n> 1. Small Talk - about 5 minutes\\n> 2. PR review: around 40 minutes\\n>     * we take a PR from the list of candidates\\n>     * we put it on the chat and give a moment to get acquainted with the PR\\n>     * discussion / review\\n>     * merge\\n> 3. Further project development - 10 minutes\\n> 4. Farewell and organization of the next MergeFest - 5minutes\\n> \\n> The whole event is intended to be an informal gathering, where we can calmly discuss important issues for us and, above all, clear the list of PRs.\\n> \\n> Best regards and see you there!\\n\\n\\n\x3c!-- AutoLangGPT: from=\\"PL\\" to=\\"ENG\\" input=\\nStaramy sie je organizowac tak czesto jak to tylko mozliwe, zazwyczaj raz lub dwa razy na tydzien. Obserwuj kanal #exceljs, tam sie zawsze zmawiamy kiedy mamy wolny czas na MF.\\n\\nWtrakcie wczesniejszych 4 mergefestow zmergowalismy 11 PR\xf3w z exceljs i kilka z xtoolset, sprawdzislismy wiecej ale jeszcze nie zostaly zmergowane. Ustalilismy jakie sa nasze cele, w tym migracja na TS i naprawa bledow. Tak wiec efekty sa namacalne i realne. Uczestnicy MF maja realny wplyw na przyszlosc projektow. \\nDziekuje wam wszystkim, ktorzy dolaczyli do tych spotkan - bardzo to doceniam!\\n--\x3e\\n\\nWe try to organize them as often as possible, typically once or twice a week. Subscirbe the #exceljs channel, we always gather there when we have some spare time for the next MergeFest.\\n\\nDuring the previous I - IV MergeFests, we merged 11 PRs from ExcelJS and few from XToolset. We reviewed more but they haven\'t been merged yet. We discuss our goals, including migrating to TypeScript and fixing errors. So the outcomes are tangible and real. Mergefest participants have a genuine impact on the projects\' future.\\n\\n**Thank you all who joined these meetings, You\'re brillant! I really appreciate it!**\\n\\n## Project: ExcelJS\\n\\n\x3c!-- AutoLangGPT: from=\\"PL\\" to=\\"ENG\\" input=\\nAktywnie review-ujemy PRy i rozwiazujemy issues z ExcelJS. Dodatkowo, [nasz fork](https://github.com/SiemaTeam/Spreadsheets) jest skonfigurowany w taki spos\xf3b, aby by\u0142 zawsze up-to-date z g\u0142\xf3wnym repo. W planach jest continues delivery do npm.\\nChcemy osi\u0105gna\u0107 coraz wi\u0119ksz\u0105 kompatybilnosc z formatem xlsx. Zmigrowac caly projekt na TypeScript i poprawic tyle bugow ile to tylko mozliwe. Trzymaj kciuki!\\n\\nA jezeli chcesz nas wesprzec, porozmiaj z nami na Discord, albo zaloz PullRequest. Mozesz rowniez zostac moim sponsorem lub wykupic moj konsulting, o ewentualnych perkach z checia porozmawiam.\\n\\njuz teraz mozesz dokonac migracje z standardowej paczki exceljs do naszej poprzez podmiane `exceljs` na `@siema-team/spreadsheets`. Obiecuje ze zachowamy kompatybilnosc wsteczna. Nasz fork jest najaktualniejsza wersja exceljs-a, mysle ze to glowny powod dlaczego warto.\\n--\x3e\\nWe actively review PRs and address issues for ExcelJS.\\nWe want to achieve greater compatibility with the xlsx format. Migrate the entire project to TypeScript, and fix as many bugs as possible. Keep your fingers crossed!\\n\\nIf you\'d like to support us, join our Discord conversation, or create a Pull Request. You can also become a sponsor or purchase my consulting services, and I\'d be happy to discuss any potential perks.\\n\\n### Project: XToolset\\n\\n\x3c!-- AutoLangGPT: from=\\"PL\\" to=\\"ENG\\" input=\\nPo prawie roku nie rozwijania tego swietnego projektu, powrocilem aby pchnac go dalej. Ma potencjal i chce go rozwinac. Dla tych co nie wiedza, xtoolset to zestaw narzedzi, ktore sie sa wyspecjalizowane na konkretych zadaniach. Generowania spreadsheetow na podstawie templatow oraz wygodnym imporcie danych.\\n\\nWkrotce wrzuce na GH pullrequesty z kilkoma poprawkami, i umieszcze bundla na serverze CDN. Potem release nowej werjsi. Najpierw jednak chce pomergowac ExcelJS-a, poniewaz to na nim xtoolset stoi.\\n--\x3e\\nAfter almost a year of not developing this fantastic project, I\'ve returned to push it further. It has potential and I want to develop it. For those who don\'t aware, XToolset is a set of tools specialized in specific tasks, such as generating spreadsheets based on templates and facilitating easy data import.\\n\\nSoon I\'ll submit some pull requests with a few improvements on GitHub and put a bundle on the CDN server. Following that, I\'ll release a new version. First, though, I want to develop ExcelJS, as xtoolset relies on it.\\n\\n### Project: is comming!\\n\\n\x3c!-- AutoLangGPT: from=\\"PL\\" to=\\"ENG\\" input=\\nDodatkowo, wlasnie rozpoczynam startup. Na ten moment dogrywam szczegoly i przymierzam sie do zebrania zespolu. Mam nadzieje ze bede mogl w niedlugiej przyszlosci pochwalic sie MVP. \\n\\nDzieki za twoja uwage. mam nadzieje ze z przyjemnoscia przeczytales moj update! Pozdrawiam i do zobaczenia wkrotce!\\n--\x3e\\n\\n~Additionally, I\'m currently launching a startup. At this moment, I\'m working out the details and getting ready to assemble a team. I hope to share our MVP in the near future.~\\n\\nThank you for your attention. I hope you enjoyed reading my update! Best regards, and see you soon!"},{"id":"/2021/11/11/release-version-2.4.4","metadata":{"permalink":"/blog/2021/11/11/release-version-2.4.4","editUrl":"https://github.com/siemienik/siemienik.github.io/edit/master/blog/2021-11-11-release-version-2.4.4.md","source":"@site/blog/2021-11-11-release-version-2.4.4.md","title":"XToolset v2.4.4","description":"What\'s Changes","date":"2021-11-11T00:00:00.000Z","formattedDate":"November 11, 2021","tags":[{"label":"OpenSource","permalink":"/blog/tags/open-source"},{"label":"Release","permalink":"/blog/tags/release"},{"label":"xlsx-renderer","permalink":"/blog/tags/xlsx-renderer"},{"label":"xlsx-import","permalink":"/blog/tags/xlsx-import"},{"label":"XToolset","permalink":"/blog/tags/x-toolset"},{"label":"Spreadsheets","permalink":"/blog/tags/spreadsheets"},{"label":"Collaboration","permalink":"/blog/tags/collaboration"},{"label":"SoftwareDevelopment","permalink":"/blog/tags/software-development"}],"readingTime":0.53,"hasTruncateMarker":false,"authors":[{"name":"Pawel Siemienik","title":"Founder","url":"/pawel","imageURL":"https://avatars.githubusercontent.com/u/2893099?v=4"}],"frontMatter":{"title":"XToolset v2.4.4","author":"Pawel Siemienik","author_title":"Founder","author_url":"/pawel","author_image_url":"https://avatars.githubusercontent.com/u/2893099?v=4","tags":["OpenSource","Release","xlsx-renderer","xlsx-import","XToolset","Spreadsheets","Collaboration","SoftwareDevelopment"]},"unlisted":false,"prevItem":{"title":"Empowering Open Source: SiemaTeam\'s Journey","permalink":"/blog/2023/04/28/siema-team-and-merge-fests"}},"content":"## What\'s Changes\\n\\n* Version number being be unified for `xlsx-import` and `xlsx-renderer`.\\n* Added node 16.x, 17.x to tests suites  by @Siemienik in https://github.com/Siemienik/XToolset/pull/197\\n* Added dateMapper with protection against invalid value passes as valid. by @Siemienik in https://github.com/Siemienik/XToolset/pull/192\\n* Implement add file from buffer by @AlinaKul in https://github.com/Siemienik/XToolset/pull/196\\n* Issue 81: Added getFirstItem method by @maryiabydanova in https://github.com/Siemienik/XToolset/pull/198\\n* Security updates (npm audit fixes).\\n\\n## New Contributors\\n* @AlinaKul made their first contribution in https://github.com/Siemienik/XToolset/pull/196\\n* @maryiabydanova made their first contribution in https://github.com/Siemienik/XToolset/pull/198\\n\\n## Links\\n\\n* NPM xlsx-renderer: https://www.npmjs.com/package/xlsx-renderer\\n* NPM xlsx-import: https://www.npmjs.com/package/xlsx-import\\n* GH Release: https://github.com/Siemienik/XToolset/releases/tag/v2.4.4\\n* **GH Discussion:** https://github.com/Siemienik/XToolset/discussions/199\\n\\n**Full Changelog**: https://github.com/Siemienik/XToolset/compare/xlsx-renderer-v2.4.3...v2.4.4"}]}')}}]);